import React from "react";
import { useClienteLoggedContext } from "../../../contextProviders/clienteLoggedContext";
function MisOpiniones() {
  //#region state manejado por el componente tanto globla como local
  const { clienteLogged, dispatch } = useClienteLoggedContext();
  // #endregion
  return(
    <div className="container">
      {clienteLogged.datoscliente.opiniones.map((opinion) => (
        <div className="card" key={opinion._id}>
          <div className="card-body">
            <h5 className="card-title">Opinion: {opinion._id}</h5>
            <h6 className="card-subtitle mb-2 text-muted">
              Fecha: {opinion.fechaOpinion}
            </h6>
            <p className="card-text">Titulo: {opinion.tituloOpinion}</p>
            <p className="card-text">Opinion: {opinion.opinion}</p>
            <p className="card-text">Puntuacion: {opinion.puntuacion}</p>
            <p className="card-text">Libro: {opinion.libroOpinion.Titulo}</p>
            <p className="card-text">Autor: {opinion.libroOpinion.Autor}</p>
            <p className="card-text">Genero: {opinion.libroOpinion.Genero}</p>
            <p className="card-text">Precio: {opinion.libroOpinion.Precio}</p>
            <p className="card-text">Imagen: {opinion.libroOpinion.ImagenLibroBASE64}</p>
          </div>
        </div>
      ))}
    </div>
  )
}

export default MisOpiniones;
